import React from 'react';
import './Projects.css';



const Projects = () => {
    /*
    * TODO:
    *  - Add some basic responsiveness when resizing the windows
    * */
    return(
        <div className='projects'>
            <div className='carousel-container'>
                <h1 className='engineering-section-header'>ENGINEERING SECTION</h1>
            </div>
            <div className='carousel-container'>
                <h1 className='art-section-header'>ART SECTION</h1>
            </div>
        </div>
    )
}

export default Projects;
